"use client";
import React, { useState } from "react";
import ModalWrapper from "../ModalWrapper";
import MenuHeader from "@/components/menubar/MenuHeader";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faCircleCheck,
  faSearch,
  faXmarkCircle,
} from "@fortawesome/free-solid-svg-icons";
import Image from "next/image";
import { MemberType } from "@/types/scheduleType";
import { faCircle } from "@fortawesome/free-regular-svg-icons";
import { useSchedule } from "@/context/schedule/ScheduleProvider";

interface InsertMemberModalProps {
  handleClose: () => void;
}

const InsertScheduleMemberModal: React.FC<InsertMemberModalProps> = ({
  handleClose,
}) => {
  const { scheduleInput, setScheduleInput } = useSchedule();
  const [searchMember, setSearchMember] = useState("");
  const members = [
    {
      id: 100,
      name: "미니언",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 101,
      name: "몽모",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 102,
      name: "짱구",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 103,
      name: "맹구",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 104,
      name: "훈이",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 105,
      name: "유리",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 106,
      name: "유승호",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 107,
      name: "김재욱",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 108,
      name: "짱구2",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 109,
      name: "맹구2",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 110,
      name: "훈이2",
      image:
        "data:image/jpeg;base64,",
    },
  ];
  const starMembers = [
    {
      id: 106,
      name: "유승호",
      image:
        "data:image/jpeg;base64,",
    },
  ];
  const [insertMembers, setInsertMembers] = useState<MemberType[]>(
    scheduleInput.members
  );

  const handleSearch = async (member: string) => {};

  const handleMember = (memberId: number) => {
    setInsertMembers((prev: MemberType[]) => {
      const isMemberSelected = prev.some((m: MemberType) => m.id === memberId);
      if (isMemberSelected) {
        return prev.filter((m: MemberType) => m.id !== memberId); // Remove member if already selected
      } else {
        const memberToAdd = members.find((m: MemberType) => m.id === memberId);
        return memberToAdd ? [...prev, memberToAdd] : prev; // Add member if found and not already selected
      }
    });
  };

  const handleSelectMember = (memberId: number) => {
    const isMemberSelected = insertMembers.some(
      (m: MemberType) => m.id === memberId
    );
    if (isMemberSelected) return true;
    return false;
  };

  const handleInsertMember = () => {
    setScheduleInput((current) => ({ ...current, members: insertMembers }));
    handleClose();
  };
  return (
    <ModalWrapper>
      <MenuHeader title="약속 멤버 선택" handleBack={handleClose} />
      <div
        className="relative flex flex-col items-center gap-2 bg-white mb-14"
        onClick={(e) => e.stopPropagation()}
      >
        <form
          action=""
          onSubmit={(e) => {
            e.preventDefault();
            handleSearch(searchMember);
          }}
          className={`my-4 relative w-4/5`}
        >
          <input
            type="text"
            className="w-full h-12 pl-2 pr-12 border border-black border-solid rounded-md"
            value={searchMember}
            placeholder="이름, 닉네임, 전화번호 검색"
            onChange={(e: React.ChangeEvent<HTMLInputElement>) =>
              setSearchMember(e.target.value)
            }
          />
          <button className="absolute -translate-y-1/2 right-4 top-1/2">
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </form>
        <section className="w-full px-10 mb-2 ">
          <div className="flex gap-3 pt-3 overflow-x-auto">
            {insertMembers.map((member) => (
              <div
                className="relative flex items-center justify-between min-w-12 shr"
                key={member.id}
              >
                <div className="flex flex-col items-center gap-1">
                  <Image
                    src={member.image}
                    width={3 * 16} // 3rem
                    height={3 * 16} // 3rem
                    alt="profile"
                    className="block object-cover w-12 h-12 border border-gray-400 border-solid rounded-full"
                  />
                  <p className="text-sm">{member.name}</p>
                </div>
                <FontAwesomeIcon
                  icon={faXmarkCircle}
                  className="absolute text-lg text-black bg-white rounded-full cursor-pointer -top-1 -right-1"
                  onClick={() => handleMember(member.id)}
                />
              </div>
            ))}
          </div>
        </section>
        <section className="w-full px-10 my-1">
          <p>즐겨찾기</p>
          {starMembers.map((member) => (
            <div
              className="flex items-center justify-between my-3"
              key={member.id}
            >
              <div className="flex items-center gap-5">
                <Image
                  src={member.image}
                  width={3 * 16} // 3rem
                  height={3 * 16} // 3rem
                  alt="profile"
                  className="block object-cover w-12 h-12 border border-gray-400 border-solid rounded-full"
                />
                <p>{member.name}</p>
              </div>
              <FontAwesomeIcon
                className="text-lg"
                icon={handleSelectMember(member.id) ? faCircleCheck : faCircle}
                onClick={() => handleMember(member.id)}
              />
            </div>
          ))}
        </section>
        <section className="w-full px-10 my-1">
          <p>친구 목록</p>
          {members.map((member) => (
            <div
              className="flex items-center justify-between my-3"
              key={member.id}
            >
              <div className="flex items-center gap-5">
                <Image
                  src={member.image}
                  width={3 * 16} // 3rem
                  height={3 * 16} // 3rem
                  alt="profile"
                  className="block object-cover w-12 h-12 border border-gray-400 border-solid rounded-full"
                />
                <p>{member.name}</p>
              </div>
              <FontAwesomeIcon
                className="text-lg"
                icon={handleSelectMember(member.id) ? faCircleCheck : faCircle}
                onClick={() => handleMember(member.id)}
              />
            </div>
          ))}
        </section>
      </div>
      <div
        className="fixed bottom-0 flex items-center justify-center cursor-pointer h-14 modal-width bg-customYellow"
        onClick={handleInsertMember}
      >
        약속 멤버 추가 ({insertMembers.length})
      </div>
    </ModalWrapper>
  );
};

export default InsertScheduleMemberModal;
